import React, { useContext } from 'react';

import Context from './../../context.js';

function IfExists(){

    const {userData} = useContext(Context);

    console.log(userData)

    return(
        <div className="if_exists">
            <div className='info'>
                <img src={userData.avatar_url}></img>
                <div className='name'>{userData.name}</div>
                <a href={userData.html_url} target='_blank' >{userData.login}</a>
                <div>
                    <span>{userData.followers}</span>followers
                    <span>{userData.following}</span>following
                </div>
            </div>
            <div className='repositories'></div>
        </div>
    );
}

export default IfExists;
